import math


class Point:
    def __init__(self, x, y):
        self.x = x
        self.y = y

    def __sub__(self, other):
        return Point(self.x - other.x, self.y - other.y)

    def __add__(self, other):
        return Point(self.x + other.x, self.y + other.y)

    def __mul__(self, k):
        return Point(self.x * k, self.y * k)

    def __div__(self, k):
        return Point(self.x / k, self.y / k)

    def __str__(self):
        return '(' + str(self.x) + ', ' + str(self.y) + ')'

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y

    def __hash__(self):
        return hash((self.x, self.y))


class Circle:
    def __init__(self, p, r):
        self.p = p
        self.r = r

    def __str__(self):
        return 'Circle(' + str(self.p) + ', ' + str(self.r) + ')'

    def __eq__(self, other):
        return self.p == other.p and self.r == other.r

    def __hash__(self):
        return hash((self.p, self.r))


def distance(p1, p2):
    return math.sqrt((p1.x - p2.x) ** 2 + (p1.y - p2.y) ** 2)


def intersection(circle1, circle2):
    d = distance(circle1.p, circle2.p)
    return d < circle1.r + circle2.r and d > abs(circle1.r - circle2.r)


def agglomeration(circle1, circle2):
    p1 = circle1.p
    p2 = circle2.p
    v1 = circle1.r
    v2 = circle2.r
    p = (p1 * v1 + p2 * v2) / (v1 + v2)
    r = circle1.r + circle2.r
    return Circle(p, r)


