def permutations(arr):
    if not arr:
        return []
    if len(arr) == 1:
        return [arr]
    perms = []
    for i in range(len(arr)):
        current = arr[i]
        remaining = arr[:i] + arr[i + 1:]
        for p in permutations(remaining):
            perms.append([current] + p)
    return perms


