    def factorial(n):
        res = 1
        for i in range(1, n + 1):
            res = res * i % MOD
        return res
    def inverse_mod(n):
        return pow(n, MOD - 2, MOD)
    def combinations(n, k):
        if k < 0 or k > n:
            return 0
        if k == 0 or k == n:
            return 1
        res = 1
        for i in range(k):
            res = res * (n - i) % MOD
            res = res * inverse_mod(i + 1) % MOD
        return res
    def binomial_coefficient(n, k):
        return combinations(n, k)
    def stirling_second(n, k):
        if k < 0 or k > n:
            return 0
        if k == 0 or k == n:
            return 1
        res = 0
        for i in range(k + 1):
            res = (res + binomial_coefficient(k, i) * pow(2, n - i, MOD) *
                pow(i + 1, MOD - 2, MOD)) % MOD
