    MOD = 10**9 + 7

    def pow_mod(base, exp):
        res = 1
        base %= MOD
        while exp > 0:
            if exp % 2 == 1:
                res = res * base % MOD
            base = base * base % MOD
            exp //= 2
        return res
    def inv_mod(n):
        return pow_mod(n, MOD - 2)
    def nCr(n, r):
        if r < 0 or r > n:
            return 0
        if r == 0 or r == n:
            return 1
        r = min(r, n - r)
        res = 1
        for i in range(r):
            res = res * (n - i) * inv_mod(i + 1) % MOD
        return res
    print(nCr(n + 2, 3) - 1)


