    def build_suffix_automaton(s):
        transitions = {}
        start = 0
        end = 0
        last = 0
        states = {0: {'$': 0}}
        for char in s:
            if char not in transitions:
                transitions[char] = {}
            if end not in transitions[char]:
                new_state = len(transitions)
                transitions[char][end] = new_state
                states[end] = states[end].setdefault('$', new_state)
                last = new_state
            end += 1
        return transitions, states

    def build_suffix_array(s):
        transitions = {}
        start = 0
        end = 0
        last = 0
        states = {0: {'$': 0}}
        for char in s:
            if char not in transitions:
                transitions[char] = {}
            if end not in transitions[char]:
                new_state = len(transitions)
                transitions[char][end] = new_state
                states[end] = states[end].setdefault('$', new_state)
                last = new_state
            end += 1
        return states

    sa = build_suffix_array(s)
    transitions, states = build_suffix_automaton(s)

    def find_path(state, char):
        if char in transitions[state]:
            return transitions[state][char]
        else:
            return None

    def find_longest_common_prefix(state, end):
        lcp = 0
        for i in range(end):
            path = find_path(state, s[i])
            if path is None:
                break
            if path in states and '$' in states[path]:
                lcp += 1
            else:
                break
            state = path
        return lcp

    def transform(s, t):
        sa = build_suffix_array(s)
        transitions, states = build_suffix_automaton(s)
        for i in range(len(t)):
            lcp = find_longest_common_prefix(sa[i], len(s))
            if lcp < len(t) - i:
                return False
        return True

    if not transform(s, t):
        print('need tree')
    elif not transform(t, s):
        print('automaton')
    else:
