        for row in image:
            new_image.append(row[::-1])
        return new_image

    def zoom_in(image):
        new_image = []
        for row in image:
            new_row = ''
            for i in range(len(row)):
                if i % 2 == 0:
                    new_row += row[i]
            new_image.append(new_row * 2)
        return new_image

    rotated_image = rotate_90_clockwise(image)
    flipped_image = flip_horizontally(rotated_image)
    final_image = zoom_in(flipped_image)

    for row in final_image:
