        neighbors = []
        for dr in [-1, 0, 1]:
            for dc in [-1, 0, 1]:
                if dr == 0 and dc == 0:
                    continue
                nr = r + dr
                nc = c + dc
                if is_valid(nr, nc):
                    neighbors.append((nr, nc))
        return neighbors

    def simulate(days):
        grid = [[(0, []) for _ in range(N)] for _ in range(N)]
        for r, c in pumpkins:
            grid[r][c] = (1, [(r, c)])

        for day in range(days):
            new_grid = [[(0, []) for _ in range(N)] for _ in range(N)]
            for r in range(N):
                for c in range(N):
                    if grid[r][c] == 0:
                        continue
                    if len(grid[r][c][1]) == 4:
                        new_grid[r][c] = grid[r][c]
                        continue
                    neighbors = get_neighbors(r, c)
                    for nr, nc in neighbors:
                        if grid[nr][nc] == 0:
                            new_grid[r][c][1].append((nr, nc))
                        else:
                            new_grid[nr][nc][1].append((nr, nc))
                            new_grid[r][c][1].append((nr, nc))
            grid = new_grid

            for r in range(N):
                for c in range(N):
                    if len(grid[r][c][1]) > 4:
                        return day + 1
        return -1

    for r, c in pumpkins:
