        return a
    return gcd(b, a % b)


def solve():
    n, m = map(int, input().split())
    a = list(map(int, input().split()))
    pairs = []
    for _ in range(m):
        pairs.append(tuple(map(int, input().split())))

    def can_divide(pair, a):
        i, j = pair
        if (i + j) % 2 == 0:
            return False
        return a[i - 1] % gcd(a[i - 1], a[j - 1]) == 0 and a[j - 1] % gcd(
            a[i - 1], a[j - 1]) == 0

    def perform_operation(pair, a):
        i, j = pair
        v = gcd(a[i - 1], a[j - 1])
        a[i - 1] //= v
        a[j - 1] //= v
        return a

    def solve_recursive(index, a, used_pairs):
        if index == m:
            return 0

        max_ops = 0
        i, j = pairs[index]

        if (i + j) % 2 == 0:
            continue

        if (i, j) in used_pairs:
            continue

        if can_divide((i, j), a):
            new_a = perform_operation((i, j), a[:])
            new_used_pairs = set(used_pairs)
            new_used_pairs.add((i, j))
            ops = 1 + solve_recursive(index + 1, new_a, new_used_pairs)
            max_ops = max(max_ops, ops)
        ops = solve_recursive(index + 1, a, used_pairs)
        max_ops = max(max_ops, ops)
        return max_ops

    print(solve_recursive(0, a, set()))


