def dfs(adj, start, end, visited, path):
    if start == end:
        return True
    visited[start] = True
    for neighbor, cost in adj[start]:
        if neighbor not in visited:
            path.append((start, neighbor, cost))
            if dfs(adj, neighbor, end, visited, path):
                return True
            path.pop()
    return False


