    import heapq

    def get_neighbors(pos):
        x, y = pos
        neighbors = []
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < r and 0 <= ny < c and grid[nx][ny] != '#':
                neighbors.append((nx, ny))
        return neighbors

    def is_safe(start, end, masters):
        visited = set()
        q = [(start, 0)]
        blocked = set()
        for master in masters:
            blocked.update(get_neighbors(master))
        while q:
            pos, dist = q.pop(0)
            if pos == end:
                return True
            if pos in visited:
                continue
            visited.add(pos)
            for neighbor in get_neighbors(pos):
                if neighbor not in blocked:
                    q.append((neighbor, dist + 1))
        return False
    start = start_bed
    min_turns = float('inf')
    for num_moves in range(1, 2 * r + 1):
        pq = []
        visited = set()
        heapq.heappush(pq, (0, start, 0))
        while pq:
            turns, pos, path_len = heapq.heappop(pq)
            if pos == fridge:
                min_turns = min(min_turns, turns)
                if path_len >= num_moves:
                    break
            if pos in visited:
                continue
            visited.add(pos)
            for neighbor in get_neighbors(pos):
                if neighbor not in visited:
                    if is_safe(pos, neighbor, masters):
                        heapq.heappush(pq, (turns + 1, neighbor, path_len + 1))
    if min_turns == float('inf'):
        print('IMPOSSIBLE')
