def solve():
    n = int(input())
    a = list(map(int, input().split()))

    def calculate_wins(start_index, taken, is_zvonko_turn):
        if len(taken) == n:
            odd_count = 0
            for x in taken:
                if x % 2 != 0:
                    odd_count += 1
            return odd_count > n // 2
        wins = 0
        if is_zvonko_turn:
            for i in range(n):
                next_index = (start_index + i) % n
                wins += calculate_wins(next_index, taken + [a[next_index]],
                    False)
        else:
            for i in range(n):
                next_index = (start_index + i) % n
                wins += calculate_wins(next_index, taken + [a[next_index]],
                    True)
        return wins
    wins = 0
    for i in range(n):
        wins += calculate_wins(i, [a[i]], False)
    print(wins)


