def solve():
    s = input()
    n = len(s)

    def factorize(s):
        i = 1
        while i < n:
            if s[i] == s[i - 1]:
                j = i + 1
                while j < n and s[j] == s[j - 1]:
                    j += 1
                yield s[i:j], j - i
                i = j
            else:
                i += 1
    factors = []
    i = 1
    while i < n:
        if s[i] == s[i - 1]:
            j = i + 1
            while j < n and s[j] == s[j - 1]:
                j += 1
            factors.append((s[i:j], j - i))
            i = j
        else:
            i += 1
    irreducible_factors = []
    for factor, count in factors:
        is_irreducible = True
        for j in range(len(factor)):
            for k in range(j + 1, len(factor)):
                if factor[j:j + 1] == factor[k:k + 1]:
                    is_irreducible = False
                    break
            if not is_irreducible:
                break
        if is_irreducible:
            irreducible_factors.append((factor, count))
    if not irreducible_factors:
        print(n)
        return
    min_weight = float('inf')
    for factor, count in irreducible_factors:
        weight = len(factor) * count + 2 * len(factor) * (count - 1) + 2 * count
        min_weight = min(min_weight, weight)
    print(min_weight)


solve()

