def solve():
    n, k = map(int, input().split())
    cards = []
    for _ in range(n):
        cards.append(list(map(int, input().split())))

    min_waste = float('inf')

    for num_envelopes in range(1, k + 1):
        for i in range(1 << n):
            envelope_sizes = []
            card_indices = []
            for j in range(n):
                if (i >> j) & 1:
                    envelope_sizes.append(cards[j][:2])
                    card_indices.append(j)

            if len(envelope_sizes) > num_envelopes:
                continue

            if len(envelope_sizes) < num_envelopes:
                continue

            wastes = []
            for card_index in card_indices:
                min_width = min(card_sizes[card_index][0], envelope_sizes[0][0])
                min_height = min(card_sizes[card_index][1], envelope_sizes[0][1])
                max_width = max(card_sizes[card_index][0], envelope_sizes[0][0])
                max_height = max(card_sizes[card_index][1], envelope_sizes[0][1])
                waste = (max_width * max_height -
                         min_width * min_height) * cards[card_index][2]
                wastes.append(waste)

            total_waste = sum(wastes)

            if total_waste < min_waste:
                min_waste = total_waste

    print(min_waste)


